pad_link_home = re.compile(r'([a-zA-Z0-9]+(://)?[a-zA-Z0-9\.]+)(/.+)')

for link in lista_guarda_link:
  string_home = re.sub(pad_link_home, '\\1', link)
  lista_guarda_home.append(string_home)

